  [],\n\t\"revision_timestamp\": \"2016-08-15T20:27:18.567087\",\n\t\"name\": \"reference-climatological-stations\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Reference Climatological Stations (RCS)
  network represents the first effort by NOAA to create and maintain a nationwide
  network of stations located only in areas where no changes in the surroundings are
  foreseen. Efforts to establish the network began in 1954 by the National Weather
  Service. The network became operational in 1966 with the selection of fifteen stations
  from a list of 28 candidate sites; six more were added as the network expanded.
  Most stations were located at university agricultural experiment stations. Core
  data elements include temperature, rainfall, and wind speed & direction. Some stations
  also measured evaporation and soil temperature. Observations were taken daily by
  volunteer observers, and were a subset of the extensive NWS Cooperative Observations
  network. Stations were assigned Cooperative Station IDs, but were provided with
  special forms on which to record wind speed and direction, elements not recorded
  at other Coop stations.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
